import React, { useState } from "react";
import Header from "./components/Header";
import CourseForm from "./components/CourseForm";
import CourseList from "./components/CourseList";
import ScheduleTable from "./components/ScheduleTable";
import Footer from "./components/Footer";
import { useCourses, useSchedules } from "./useCourses";

function App() {
    const [allSchedules, setAllSchedules] = useState([]);
    const [currentSchedule, setCurrentSchedule] = useState(0);
    const [min, setMin] = useState(2);
    const [max, setMax] = useState(4);
    const [term, setTerm] = useState("2024");
    const [quarter, setQuarter] = useState("Winter");

    const {
        courses,
        forceList,
        errorMessage,
        setErrorMessage,
        handleAddCourse,
        handleRemoveCourse,
        handleToggleForce,
    } = useCourses();

    const sortSchedules = (schedules) => {
        if (schedules.length <= 0) return;

        const sortValue = document.getElementById("scheduleSort").value;

        schedules.sort((a, b) => {
            if (sortValue === "score") {
                return b.score - a.score;
            } else if (sortValue === "end") {
                return b.weights.end - a.weights.end;
            } else if (sortValue === "gap") {
                return b.weights.gap - a.weights.gap;
            } else if (sortValue === "gpa") {
                return b.weights.gpa - a.weights.gpa;
            } else if (sortValue === "start") {
                return b.weights.start - a.weights.start;
            }
            return 0;
        });
    };

    const { generateJSON, displaySchedule, clearSchedule } = useSchedules(
        setAllSchedules,
        setCurrentSchedule,
        displaySchedule, // Ensure to pass the renamed function
        currentSchedule,
        setErrorMessage, // Pass setErrorMessage to useSchedules
        sortSchedules // Pass sortSchedules to useSchedules
    );

    return (
        <div className="App">
            <Header />
            <div className="container mx-auto px-4 py-6">
                <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                    <div>
                        <CourseForm onAddCourse={handleAddCourse} />
                        <CourseList
                            courses={courses}
                            onRemoveCourse={handleRemoveCourse}
                            onToggleForce={handleToggleForce}
                        />
                        <button
                            className="mt-4 btn btn-primary"
                            onClick={() =>
                                generateJSON(
                                    courses,
                                    forceList,
                                    min,
                                    max,
                                    term,
                                    quarter
                                )
                            }>
                            Submit
                        </button>
                        {errorMessage && (
                            <div
                                id="errorMessage"
                                className="mt-4 text-red-500">
                                {errorMessage}
                            </div>
                        )}
                    </div>
                    <div>
                        <div className="mb-4">
                            <label htmlFor="minSelect" className="block">
                                Minimum Courses:
                            </label>
                            <select
                                id="minSelect"
                                value={min}
                                onChange={(e) => setMin(e.target.value)}
                                className="form-select mt-1 block w-full">
                                {[...Array(6).keys()].map((i) => (
                                    <option key={i + 1} value={i + 1}>
                                        {i + 1}
                                    </option>
                                ))}
                            </select>
                        </div>
                        <div className="mb-4">
                            <label htmlFor="maxSelect" className="block">
                                Maximum Courses:
                            </label>
                            <select
                                id="maxSelect"
                                value={max}
                                onChange={(e) => setMax(e.target.value)}
                                className="form-select mt-1 block w-full">
                                {[...Array(10).keys()].map((i) => (
                                    <option key={i + 1} value={i + 1}>
                                        {i + 1}
                                    </option>
                                ))}
                            </select>
                        </div>
                        <div className="mb-4">
                            <label htmlFor="termSelect" className="block">
                                Year:
                            </label>
                            <select
                                id="termSelect"
                                value={term}
                                onChange={(e) => setTerm(e.target.value)}
                                className="form-select mt-1 block w-full">
                                {[2024, 2025].map((year) => (
                                    <option key={year} value={year}>
                                        {year}
                                    </option>
                                ))}
                            </select>
                        </div>
                        <div className="mb-4">
                            <label htmlFor="quarterSelect" className="block">
                                Quarter:
                            </label>
                            <select
                                id="quarterSelect"
                                value={quarter}
                                onChange={(e) => setQuarter(e.target.value)}
                                className="form-select mt-1 block w-full">
                                {["Winter", "Spring", "Summer", "Fall"].map(
                                    (qtr) => (
                                        <option key={qtr} value={qtr}>
                                            {qtr}
                                        </option>
                                    )
                                )}
                            </select>
                        </div>
                        <ScheduleTable
                            schedule={allSchedules}
                            currentSchedule={currentSchedule}
                            displaySchedule={displaySchedule}
                            clearSchedule={clearSchedule}
                        />
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}

export default App;
